import { FormLabel, TextField } from "@mui/material";
import { Box } from "@mui/system";

import "./Book/Book.css";
import React from "react";


const AddBook = () => {
  return (
    
    <form>

      <Box 
      display="flex" 
      flexDirection="column" 
      justifyContent={'center'}
      maxWidth={700} 
      sx= {{mt:'100px'}}
      alignContent = {"center"}
      alignSelf = "center"
      marginLeft = {"auto"}
      marginRight = "auto"
      >
      
      
        <FormLabel>Name </FormLabel>
        <TextField margin="normal"  name="name" label="Name" />
        <FormLabel>Author</FormLabel>
        <TextField margin="normal" name="author" />
        <FormLabel>Description</FormLabel>
        <TextField margin="normal" name="description" />
        <FormLabel>Price</FormLabel>
        <TextField margin="normal" name="price" />
       
      </Box>


    </form>
    
  );
};

export default AddBook;
